svg.script:
//  

window.addEventListener("DOMContentLoaded", () => {   
var svg = document.querySelector("#SvgjsSvg1001");  
var point = svg.createSVGPoint();  
var selectedElement, offset;  
var startClient = svg.createSVGPoint();  
var startGlobal = svg.createSVGPoint();  
var viewBox = svg.viewBox.baseVal;  
var zoom = {  
  animation: null,  
  scaleFactor: 1.6,  
  duration: 0.5,  
  ease: null,  
};  
function getMousePosition(evt) {  
  var CTM = svg.getScreenCTM();  
  return {  
    x: (evt.clientX - CTM.e) / CTM.a,  
    y: (evt.clientY - CTM.f) / CTM.d  
  };  
}  
function startDrag(evt) {  
  selectedElement = svg;  
   offset = getMousePosition(evt);  
}  
function drag(evt) {  
  if (selectedElement) {  
    var coord = getMousePosition(evt);  
    viewBox.x -= coord.x - offset.x;  
    viewBox.y -= coord.y - offset.y;  
  }  
}  
function endDrag(evt) {  
  selectedElement = null;  
}  
function onWheel(event) {  
  var normalized;   
  var delta = event.wheelDelta;  
  if (delta) {  
    normalized = (delta % 120) == 0 ? delta / 120 : delta / 12;  
  } else {  
    delta = event.deltaY || event.detail || 0;  
    normalized = -(delta % 3 ? delta * 10 : delta / 3);  
  }  

  var scaleDelta = normalized > 0 ? 1 / zoom.scaleFactor : zoom.scaleFactor;   

  point.x = event.clientX;  
  point.y = event.clientY;  
  var startPoint = point.matrixTransform(svg.getScreenCTM().inverse());  

  var fromVars = {  
    ease: zoom.ease,  
    x: viewBox.x,  
    y: viewBox.y,  
    width: viewBox.width,  
    height: viewBox.height,  
  };  
  viewBox.x -= (startPoint.x - viewBox.x) * (scaleDelta - 1);  
  viewBox.y -= (startPoint.y - viewBox.y) * (scaleDelta - 1);  
  viewBox.width *= scaleDelta;  
  viewBox.height *= scaleDelta;    
}  
window.addEventListener("wheel", onWheel);  
window.addEventListener('mousedown', startDrag);  
window.addEventListener('mousemove', drag);  
window.addEventListener('mouseup', endDrag);  
}); 

//
